  var birdseye_options = {
	    series: { phenotype_hl: { show: true } },
	    lines: { show: false },
	    shadowSize: 0,
	    points: { show: true, radius: 0.7 },
	    grid: { hoverable: true, clickable: true },

	    xaxis: { zoomRange: [null], panRange: [null], show: false },

	    zoom: { interactive: true },
	    pan: { interactive: true }
	};
  
  /**
   *  Global constants. 
   */
  var MAX_ROWS = 16, MAX_COLUMNS = 100;
  
  
  /**
   *  Generalized, optimized and (slightly) re-formatted.
   */
  function compressDatasets(datasets) {
      var compressedDatasets = [];
	  /* Init lookup table. */
      var isCompressed = [];
      for (var row = 0; row < MAX_ROWS; row++) {
        isCompressed.push([]);
      }  
      
      /* Find the maximum across data sets. */
      var maxDatapoints = 0;
	  var maxValues = 0;
      for (var dataset = 0; dataset < datasets.length; dataset++) {
	    compressedDatasets.push([]);
        for (var datapoint = 0, length = datasets[dataset].length; datapoint < length; datapoint++) {
		  tuple = datasets[dataset][datapoint];
		  if (tuple) {
		    maxDatapoints = Math.max(maxDatapoints, parseFloat(tuple[0]));
		    maxValues = Math.max(maxValues, parseFloat(tuple[1]));
		  }
		}
      }
      
      /* Compress data points. */
      var tuple, x, y;
	  // loop in reverse to match colors in full-size display better
      for (var dataset = datasets.length - 1; dataset >= 0; dataset--) {
        for (var datapoint = 0, length = datasets[dataset].length; datapoint < length; datapoint++) {
          tuple = datasets[dataset][datapoint];
          if (tuple !== null) {
            /* Scale x and y to fit within MAX_COLUMNS and MAX_ROWS. */
            x = (tuple[0] * (MAX_COLUMNS - 1) / maxDatapoints) << 0;
            y = (parseFloat(tuple[1]) * (MAX_ROWS - 1) / maxValues) << 0;
            if (!isCompressed[y][x]) {
                isCompressed[y][x] = true;
                compressedDatasets[dataset].push([x, y]);
            }
          }
        }
      }  
      
      return compressedDatasets;
  }
